import React from "react";

const TopBarContainer = ({ contentFormToggle, setContentFormToggle }) => {
  return (
    <div className="topbar-container">
      <div className="topbar-content">
        {contentFormToggle ? (
          <button onClick={() => setContentFormToggle(false)}>List</button>
        ) : (
          <button onClick={() => setContentFormToggle(true)}>Grid</button>
        )}
      </div>
    </div>
  );
};

export default TopBarContainer;
